import logo from './logo.svg';
import './App.css';
import Styled from 'styled-components';


const Banner = Styled.div `
    display: flex;
    width: 100%;
    height: 30rem;
    background: url('./racing.jpg');
    background-position: center;
    background-repeat: no-repeat;
    background-size: cover;
`;

const Nav = Styled.div `
    display: flex;
    flex-direction: row;
    width: 100%;
    ul {
      li {
        list-style: none;
        display: inline;
        margin-left: 10rem;
      }
    }
`;

function App() {
  return (
    <div className="App">
      <header>

        <Nav>
          <ul>
            <li><img src="./logo.png" style={{width: '80px'}} /></li>
            <li>Home</li>
            <li>Fixtures</li>
            <li>Podcasts</li>
            <li>Players</li>
            <li>About Us</li>
          </ul>
        </Nav>
        <Banner/>
        </header>
        <br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>
    </div>
  );
}

export default App;
